using namespace std;

template<typename T> 
void PrintRange(T tbegin,T tend) {
    auto a = tbegin;
    while (tbegin != tend) {
        cout << *tbegin;
        if (++a != tend) {
            cout << " ";
        }
        ++tbegin;
    }
    cout << endl;
    
}

template <typename T4, typename T5>
void EraseAndPrint(T4 &container, T5 it) {

    auto it_erase = container.erase(it);
    PrintRange(container.begin(), it_erase);
    PrintRange(it_erase, container.end());
}


int main() {
    vector<string> langs = {"Python"s, "Java"s, "C#"s, "Ruby"s, "C++"s};
    EraseAndPrint(langs, langs.begin());
    return 0;
}

internal class Program
{
    private static void Main(string[] args)
    {
        int[] nums = Console.ReadLine().Split().Select(int.Parse).ToArray();
        //BubbleSort(nums);
        //SelectionSort(nums);
        InsertionSort(nums);
        Console.WriteLine(String.Join(" ", nums));
    }


    public static void BubbleSort(int[] nums)
    {
        int n = nums.Length;

        for (int i = 0; i < n; i++)
        {
            for (int j = 0; j < n - 1; j++)
            {
                if (nums[j] < nums[j + 1])
                {
                    int tempnum = nums[j];
                    nums[j] = nums[j + 1];
                    nums[j + 1] = tempnum;
                }
            }
        }

    }


    public static void SelectionSort(int[] nums)
    {


        int n = nums.Length;
        for (int i = 0; i < n - 1; i++)
        {
            int smallestnum = i;
            for (int j = i + 1; j < n; j++)
            {
                if (nums[j] > nums[smallestnum])
                {
                    smallestnum = j;
                }
            }

            int curnum = nums[smallestnum];
            nums[smallestnum] = nums[i];
            nums[i] = curnum;
        }
    }


    public static void InsertionSort(int[] nums)
    {
        int n = nums.Length;
        for (int i = 1; i < n; i++)
        {
            int key = nums[i];
            int j = i - 1;

            while (j >= 0 && nums[j] < key)
            {
                nums[j + 1] = nums[j];
                j = j - 1;
            }

            nums[j + 1] = key;
        }
    }
   
}

